import React from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
// import App from './App';
import * as serviceWorker from './serviceWorker';
import {Login} from './login';
import 'sass/LoginSty.css';

ReactDOM.render(
  <Login />,
  document.getElementById('root')
);
serviceWorker.unregister();
